import React from "react";

function Book(props){
    return (
        <>
        <h2>{props.title}</h2>
        <p>{`AUTHOR:  ${props.author}`}</p>
        <p><b>{`CATEGORY:  ${props.category}`}</b></p>
        </>
    );
}
export default Book;
